import React from "react";

const Login=()=>{

    return(
        <div className="form">
            <form>
                <label>UserName</label>
                <input type="text"/>
                <label>Password</label>
                <input type="password"/>
            </form>
            <div className="login">
                <p id="log">
                    Log in
                </p>
                <p id="forgot">
                    Forgot Password?
                </p>
            </div>
        </div>

    )
};

export default Login;
